import React,{useContext} from 'react'
import {GlobalState} from "../../../GlobalState"

function History() {
    const state = useContext(GlobalState)
    const history = state.userAPI.history
    return (
        <div>
            {
                history.map(history => (
                    <div>
                        history.user_id
                        </div>
                ))
            }
        </div>
    )
}

export default History
